import React, { Component } from "react";

export default class Cell extends Component {
  state = {
    // color: null,
    // cellNumber: null,
    // x: this.props.cell.i,
    // y: this.props.cell.j,
    // taken: false
  };

  componentDidMount() {
    this.setState({ cell: this.props.cell });
  }

  render() {
    return;
    {
      this.state.cell && (
        <div
          className="cell"
          className={this.state.cell.type === "meteorite" ? "meteorite" : ""}
        />
      );
    }
  }
}
